import React from 'react';
import PropTypes from 'prop-types';
import { AppBar, Box, CssBaseline, Divider, Drawer, IconButton, List, ListItem, ListItemButton, ListItemIcon, ListItemText, Toolbar, Typography } from '@mui/material';
import { Link } from 'react-router-dom';
import MenuIcon from '@mui/icons-material/Menu';
import MeetingRoomIcon from '@mui/icons-material/MeetingRoom';
import SpaceDashboardIcon from '@mui/icons-material/SpaceDashboard';
import CategoryIcon from '@mui/icons-material/Category';
import ControlPointDuplicateIcon from '@mui/icons-material/ControlPointDuplicate';
import HelpOutlineIcon from '@mui/icons-material/HelpOutline';

const drawerWidth = 260; // Slightly wider for better spacing

const InterviewPortal = ({ children }) => {
  const [mobileOpen, setMobileOpen] = React.useState(false);

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  const menuItems = [
    { name: 'Dashboard', path: '/dashboard', icon: <SpaceDashboardIcon /> },
    { name: 'Category', path: '/category', icon: <CategoryIcon /> },
    { name: 'SubCategory', path: '/subcategory', icon: <ControlPointDuplicateIcon /> },
    { name: 'Q&A', path: '/qa', icon: <HelpOutlineIcon /> }
  ];

  const drawer = (
    <div style={{ 
      backgroundColor: '#0A192F', 
      height: '100vh', 
      color: 'white',
      fontFamily: "'Poppins', sans-serif",
      boxShadow: '2px 0px 5px rgba(255,255,255,0.1)'
    }}>
      <Toolbar sx={{ backgroundColor: '#112D4E', color: 'white' }}>
        <Typography variant="h6" sx={{ fontSize: '20px', fontWeight: 'bold' }}>Interview Portal</Typography>
      </Toolbar>
      <Divider sx={{ backgroundColor: 'rgba(255,255,255,0.2)' }} />
      <List>
        {menuItems.map((item) => (
          <Link key={item.name} to={item.path} style={{ textDecoration: 'none', color: 'white' }}>
            <ListItem disablePadding>
              <ListItemButton sx={{
                '&:hover': {
                  background: 'linear-gradient(90deg, #3A7CA5, #00A8E8)',
                  color: 'white'
                }
              }}>
                <ListItemIcon sx={{ color: 'white' }}>{item.icon}</ListItemIcon>
                <ListItemText primary={item.name} sx={{ fontSize: '16px', fontWeight: '500' }} />
              </ListItemButton>
            </ListItem>
          </Link>
        ))}
      </List>
    </div>
  );

  return (
    <Box sx={{ display: 'flex', fontFamily: "'Poppins', sans-serif" }}>
      <CssBaseline />
      <AppBar
        position="fixed"
        sx={{
          backgroundColor: '#112D4E',
          width: { sm: `calc(100% - ${drawerWidth}px)` },
          ml: { sm: `${drawerWidth}px` },
          fontFamily: "'Poppins', sans-serif"
        }}
      >
        <Toolbar sx={{ justifyContent: 'space-between' }}>
          <IconButton
            color="inherit"
            edge="start"
            onClick={handleDrawerToggle}
            sx={{ display: { sm: 'none' } }}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" sx={{ fontSize: '18px', fontWeight: 'bold' }}>Dashboard</Typography>
          <MeetingRoomIcon />
        </Toolbar>
      </AppBar>

      <Box component="nav" sx={{ width: { sm: drawerWidth }, flexShrink: { sm: 0 } }}>
        <Drawer
          variant="temporary"
          open={mobileOpen}
          onClose={handleDrawerToggle}
          sx={{
            display: { xs: 'block', sm: 'none' },
            '& .MuiDrawer-paper': { width: drawerWidth, backgroundColor: '#0A192F' }
          }}
        >
          {drawer}
        </Drawer>

        <Drawer
          variant="permanent"
          sx={{
            display: { xs: 'none', sm: 'block' },
            '& .MuiDrawer-paper': { width: drawerWidth, backgroundColor: '#0A192F' }
          }}
          open
        >
          {drawer}
        </Drawer>
      </Box>

      <Box component="main" sx={{ flexGrow: 1, p: 3, width: { sm: `calc(100% - ${drawerWidth}px)` } }}>
        <Toolbar />
        {children}
      </Box>
    </Box>
  );
};

InterviewPortal.propTypes = {
  children: PropTypes.node,
};

export default InterviewPortal;
